import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Form, Button, Col } from "react-bootstrap";
class Login extends Component {

    constructor(props) {
        super(props);
        this.state = {
            passcode: "",
            passcodePassword: ""
        }
        this.login = this.login.bind(this);
        this.onChange = this.onChange.bind(this);
    }

    login() {
        console.log("Login function");
    }

    onChange(e) {
        this.setState({
            passcode: e.target.value,
            passcodePassword: e.target.value,
        })
    }

  render() {
    return (
      <Form style={{ justifyContent: "center" }}>
        <Form.Group controlId="formGroupEmail">
          <Form.Label>Passcode</Form.Label>
          <Form.Control type="text" placeholder="Enter Passcode" onChange= {this.onChange} />
        </Form.Group>
        <Form.Group controlId="formGroupPassword">
          <Form.Label>Passcode Password</Form.Label>
          <Form.Control type="password" placeholder="Password" onChange= {this.onChange}/>
        </Form.Group>
        <Button variant="success" className= "button" type="submit" onClick ={this.login}>Login</Button>
      </Form>
    );
  }
}
export default Login;
